import styles from './NavBar.module.css';
import React, { useState, useEffect } from 'react'

function NavBar() {

  const [textData, setTextData] = useState();

  const textСhannels = [
    { name: 'чат' },
    { name: 'матеріали' },
    { name: 'домашки' },
    { name: 'інформація' },
  ]

  return (
    <nav className={styles.nav}>
      <div className={styles.div}>
        Текстові канали
      </div>
      <div className={styles.div}>
        Голосові канали
      </div>
    </nav>
  )
}

export default NavBar
